import './css/Header.css';
import logo from './img/logo.svg'
function Header() {
  return (
    <div className="headerCont">
      <header className="header">
       <img src={logo} alt="logo"/>
       <h2>my travel journal.</h2>
      </header>
    </div>
  );
}

export default Header;
